    this.state = {
      time: new Date(),
    };
    // this.ProgramTime = this.ProgramTime.bind(this);
  }
  prog() {
    return console.log("Text");
  }
  render() {
    return (
      <div>
        {" "}
        {this.prog};<h3>{this.state.time}</h3>
      </div>
    );
  }
  // ProgramTime = () => {};
}
export default Clock;

